bioghist.p:
Voor de periode 1957 - 1969: 


behandeling van de aangelegenheden betreffende de landbouwhogeschool en de hieraan verbonden instituten;

alle overige aangelegenheden betreffende het landbouwonderwijs, waartoe gerekend worden de opleidingen die een voorbereiding geven op de beroepen in de landbouw;

opleiding en verdere ontwikkeling van leerkrachten voor het landbouw¬onderwijs.

En voor de periode 1970 - 1980 golden de volgende taken:


de aangelegenheden met betrekking tot het landbouwonderwijs;

de aangelegenheden inzake het beheer van de Rijks land- en tuinbouw- en  landbouwtechnologische scholen;

het rijkstoezicht op de lagere, middelbare en hogere landbouwscholen, alsmede op het cursorisch landbouwonderwijs, de landbouwpraktijk- en vakscholen;

de vraagstukken met betrekking tot het landbouwonderwijs in het kader van de EEG en van andere internationale organisaties;

de aangelegenheden betreffende de landbouwhogeschool en de hieraan verbonden instituten.

Vanaf 1962 kende de Directie Landbouwonderwijs drie onderdelen:


de Afdeling Land- en Tuinbouwonderwijs (1962 - 1963), later de Afdeling Landbouwonderwijs (1964-1965);

de Rijkslandbouwleergangen;

de Inspectie Land- en Tuinbouwonderwijs (1962 - 1963), later de Inspectie Landbouwonderwijs.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
